script: |
  super -f text -I q7766.spq | sort > q7766.out

inputs:
  - name: q7766.spq
    data: |
      SELECT 49 - + col0 * - col1 FROM tab2 (FORMAT parquet) WHERE NOT - + CAST ( NULL AS INTEGER ) + + col2 * + 7 BETWEEN - col2 * - + 81 + - - col1 + - col0 / col1 AND 33 - 76;
  - name: tab2

outputs:
  - name: q7766.out
    data: |
